INSERT INTO `t_inform` VALUES ('13cc01c8-ec01-4432-b275-fabd87eda700', '不动产服务条例', 'news', '/imagesService/getImage?params=/inform/20170630/admin/312cfead-5244-4146-a45b-77898505546eQQ截图20170630132923.png', '<p align=\"center\">第一章&nbsp; 总&nbsp;&nbsp;&nbsp; 则</p><p>　　第一条&nbsp; 为规范不动产登记行为，细化不动产统一登记制度，方便人民群众办理不动产登记，保护权利人合法权益，根据《不动产登记暂行条例》（以下简称《条例》），制定本实施细则。</p><p>　　第二条&nbsp; 不动产登记应当依照当事人的申请进行，但法律、行政法规以及本实施细则另有规定的除外。</p><p>　　房屋等建筑物、构筑物和森林、林木等定着物应当与其所依附的土地、海域一并登记，保持权利主体一致。</p><p>　　第三条&nbsp; 不动产登记机构依照《条例》第七条第二款的规定，协商办理或者接受指定办理跨县级行政区域不动产登记的，应当在登记完毕后将不动产登记簿记载的不动产权利人以及不动产坐落、界址、面积、用途、权利类型等登记结果告知不动产所跨区域的其他不动产登记机构。</p><p>　　第四条&nbsp; 国务院确定的重点国有林区的森林、林木和林地，由国土资源部受理并会同有关部门办理，依法向权利人核发不动产权属证书。</p><p>　　国务院批准的项目用海、用岛的登记，由国土资源部受理，依法向权利人核发不动产权属证书。</p><p>　　中央国家机关使用的国有土地等不动产登记，依照国土资源部《在京中央国家机关用地土地登记办法》等规定办理。</p><p></p>', '2017-06-30', 'admin', 'urgent', '0', null);
