INSERT INTO `t_inform` VALUES ('2d4ffdb5-4691-414d-847d-42748d5a77e7', '不动产条例二', 'news', '/imagesService/getImage?params=/inform/20170630/admin/b2401815-4937-4973-b492-157b5e654f7aQQ截图20170630132923.png', '<p align=\"center\">第三章&nbsp; 登记程序</p><p>　　第九条&nbsp; 申请不动产登记的，申请人应当填写登记申请书，并提交身份证明以及相关申请材料。</p><p>　　申请材料应当提供原件。因特殊情况不能提供原件的，可以提供复印件，复印件应当与原件保持一致。</p><p>　　第十条&nbsp; 处分共有不动产申请登记的，应当经占份额三分之二以上的按份共有人或者全体共同共有人共同申请，但共有人另有约定的除外。</p><p>　　按份共有人转让其享有的不动产份额，应当与受让人共同申请转移登记。</p><p>　　建筑区划内依法属于全体业主共有的不动产申请登记，依照本实施细则第三十六条的规定办理。</p><p>　　第十一条&nbsp; 无民事行为能力人、限制民事行为能力人申请不动产登记的，应当由其监护人代为申请。</p><p>　　监护人代为申请登记的，应当提供监护人与被监护人的身份证或者户口簿、有关监护关系等材料；因处分不动产而申请登记的，还应当提供为被监护人利益的书面保证。</p><p>　　父母之外的监护人处分未成年人不动产的，有关监护关系材料可以是人民法院指定监护的法律文书、经过公证的对被监护人享有监护权的材料或者其他材料。</p><p></p>', '2017-06-30', 'admin', 'urgent', '0', null);
INSERT INTO `t_inform` VALUES ('3', '【平台新闻资讯】8月8日对外服务将如期而至', 'news', '/imagesService/getImage?params=/inform/20170630/admin/fa024def-6f0e-4c21-b1fc-fcf3b9d84f3dQQ截图20170630132807.png', '<div class=\"newsLeftTitleContent\"><p style=\"text-align:center;\"><b><span style=\"font-family: 宋体;font-size: 21px;background: rgb(255, 255, 255);\">【公告】8月8日对外服务将如期而至</span></b></p><p><br/></p><p>&nbsp;</p><p><span style=\"font-family:宋体;font-size:19px;\">亲爱的用户：</span></p><p><span style=\"font-family:宋体;font-size:19px;\"><br/></span></p><p style=\"text-indent:37px;\"><span style=\"font-family:宋体;font-size:19px;\">您好！对外服务官网公开版1.0将于8月8号正式上线，敬请期待！</span></p><p style=\"text-indent:37px;\"><span style=\"font-family:宋体;font-size:19px;\"><br/></span></p><p style=\"text-indent:37px;\"><span style=\"font-family:宋体;font-size:19px;\">希望正式版网站能给您带来舒心、易用的访问体验！由于新网站还处于建设完善过程中，难免有纰漏及不足之处，还希望不吝赐教，把您好的意见和建议发给我们，我们会努力使网站更加完善。</span></p><p style=\"text-indent:37px;\"><span style=\"font-family:宋体;font-size:19px;\"><br/></span></p><p style=\"text-indent:37px;\"><span style=\"font-family:宋体;font-size:19px;\">在此期间，给大家带来的不便，敬请谅解。感谢您一直以来对我们工作的支持和关注！</span></p><p><br/></p><p style=\"text-align: right;\"><span style=\"font-family:宋体;font-size:19px;\">贵州省国土资源部</span></p><p style=\"text-align: right;\"><span style=\"font-family:宋体;font-size:19px;\">2016年8月4日</span></p></div><div class=\"newsDetailsBottom\"><span class=\"newsSee newsStyleImg\">用户通告信息</span></div>', '2017-06-29', '韩梅梅', 'commonly', '0', null);
