INSERT INTO `t_inform` VALUES ('50bdd889-6c46-4f7f-bda6-ac2ceb187ddf', '四', 'news', '/imagesService/getImage?params=/inform/20170630/admin/c689d713-47ab-4e35-a5c2-fea855b220dcMrRight.png', '<p>第十五条&nbsp; 不动产登记机构受理不动产登记申请后，还应当对下列内容进行查验：</p><p>　　（一）申请人、委托代理人身份证明材料以及授权委托书与申请主体是否一致；</p><p>　　（二）权属来源材料或者登记原因文件与申请登记的内容是否一致；</p><p>　　（三）不动产界址、空间界限、面积等权籍调查成果是否完备，权属是否清楚、界址是否清晰、面积是否准确；</p><p>　　（四）法律、行政法规规定的完税或者缴费凭证是否齐全。</p><p>　　第十六条&nbsp; 不动产登记机构进行实地查看，重点查看下列情况：</p><p>　　（一）房屋等建筑物、构筑物所有权首次登记，查看房屋坐落及其建造完成等情况；</p><p>　　（二）在建建筑物抵押权登记，查看抵押的在建建筑物坐落及其建造等情况；</p><p>　　（三）因不动产灭失导致的注销登记，查看不动产灭失等情况。</p><p></p>', '2017-06-30', 'admin', 'urgent', '0', null);
INSERT INTO `t_inform` VALUES ('89d5f085-660e-452d-9347-2a5af9561901', '五', 'news', '/imagesService/getImage?params=/inform/20170630/admin/8a118691-e878-47dd-8b8e-0cdb93e859a7QQ截图20170620160007.png', '<p>第十七条&nbsp; 有下列情形之一的，不动产登记机构应当在登记事项记载于登记簿前进行公告，但涉及国家秘密的除外：</p><p>　　（一）政府组织的集体土地所有权登记；</p><p>　　（二）宅基地使用权及房屋所有权，集体建设用地使用权及建筑物、构筑物所有权，土地承包经营权等不动产权利的首次登记；</p><p>　　（三）依职权更正登记；</p><p>　　（四）依职权注销登记；</p><p>　　（五）法律、行政法规规定的其他情形。</p>', '2017-06-30', 'admin', 'urgent', '0', null);
INSERT INTO `t_inform` VALUES ('a169c2a0-73ff-4207-b178-bd1ac1fee6e8', '水城县不动产登记中心入驻县政务服务中心', 'news', '/imagesService/getImage?params=/inform/20170707/admin/472dc57e-716d-4951-a9a7-1ee1589d631fQQ截图20170707152352.png', '<p><span style=\"font-family: &quot;;Helvetica Neue&quot;, Helvetica, Arial, sans-seriffont-size: small;\">10月8日，水城县国土资源局不动产登记中心正式入驻县政务服务中心，并接待了首位前来咨询办事的群众，标志着我县不动产统一登记发证工作正式拉开序幕。&nbsp;</span></p><p><span style=\"font-family: &quot;;Helvetica Neue&quot;, Helvetica, Arial, sans-seriffont-size: small;\">　　不动产登记中心在县政务服务大厅设有三个窗口（4号、5号、6号），统一受理土地所有权、国有建设用地使用权、房屋所有权、构筑物所有权、地役权的首次登记、转移登记、抵押登记、变更登记、注销登记、更正登记、异议登记、预告登记、查封解封登记等业务。截至10月24日，共受理不动产登记业务17件，办结3件，接待群众咨询25余人次。&nbsp;</span></p><p><span style=\"font-family: &quot;;Helvetica Neue&quot;, Helvetica, Arial, sans-seriffont-size: small;\">　　实施不动产统一登记是落实《物权法》规定、保护公民合法财产权的法律手段，也是推进简政放权、减少多头管理、逐步实现一个窗口对外、方便企业和群众、降低成本的有效举措。</span></p><p style=\"font-family: &quot;;Helvetica Neue&quot;, Helvetica, Arial, sans-seriffont-size: small;\"></p>', '2017-07-07', 'admin', 'urgent', '0', null);
