INSERT INTO `t_inform` VALUES ('bdd54094-6fab-4286-bb00-15c8c6a7efb7', '6月30日不动产上线公告', 'announcement', '/imagesService/getImage?params=/inform/20170630/admin/d22ad712-3738-43a9-b195-19cf30a3571eQQ截图20170630132807.png', '<div style=\"text-align: center;\">不动产登记暂行条例实施细则</div><div style=\"text-align: left;\"><p align=\"center\">中华人民共和国国土资源部令</p><p align=\"center\">　　第63号</p><p>　　《不动产登记暂行条例实施细则》已经2015年6月29日国土资源部第3次部务会议审议通过，现予公布，自公布之日起施行。　　</p></div><p></p>', '2017-06-30', 'admin', 'urgent', '0', null);
INSERT INTO `t_inform` VALUES ('c09bdd48-91f4-4b59-954a-4ffe4ea97321', '六', 'news', '/imagesService/getImage?params=/inform/20170630/admin/60e91791-0b8b-49b1-afc4-bf7bce27894f43a7d933c895d1434a3d2ae37af082025baf07a3.png', '<p>第十八条&nbsp; 不动产登记公告的主要内容包括：</p><p>　　（一）拟予登记的不动产权利人的姓名或者名称；</p><p>　　（二）拟予登记的不动产坐落、面积、用途、权利类型等；</p><p>　　（三）提出异议的期限、方式和受理机构；</p><p>　　（四）需要公告的其他事项。</p><p>　　第十九条&nbsp; 当事人可以持人民法院、仲裁委员会的生效法律文书或者人民政府的生效决定单方申请不动产登记。</p><p>　　有下列情形之一的，不动产登记机构直接办理不动产登记：</p><p>　　（一）人民法院持生效法律文书和协助执行通知书要求不动产登记机构办理登记的；</p><p>　　（二）人民检察院、公安机关依据法律规定持协助查封通知书要求办理查封登记的；</p><p>　　（三）人民政府依法做出征收或者收回不动产权利决定生效后，要求不动产登记机构办理注销登记的；</p><p>　　（四）法律、行政法规规定的其他情形。</p><p>　　不动产登记机构认为登记事项存在异议的，应当依法向有关机关提出审查建议。</p><p></p>', '2017-06-30', '1', 'urgent', '1', null);
INSERT INTO `t_inform` VALUES ('cc28bf8f-ea45-4f13-b4b2-d47c2e2a0be0', '7-9不动产信息公告', 'announcement', '/imagesService/getImage?params=/inform/20170709/admin/949bd568-6af6-4274-bdc2-ccf3877b0767QQ截图20170630132807.png', '<div class=\"para\" label-module=\"para\">不动产（immovable property）这一词原本来源于日本，意思类似房地产。在中国是指依自然性质或法律规定不可移动或者移动后会引起性质、形状改变的财产，包括建筑物、构筑物等。</div><div class=\"para\" label-module=\"para\">2013年11月20日，国务院常务会议决定，整合不动产<a href=\"http://baike.baidu.com/item/%E7%99%BB%E8%AE%B0\" target=\"_blank\">登记</a>职责、建立不动产统一登记制度。<sup>[1]</sup><a name=\"ref_[1]_10970\" class=\"sup-anchor\">&nbsp;</a> 不动产登记参照《不动产登记管理条例》。</div><p></p>', '2017-07-09', 'admin', 'urgent', '0', null);
INSERT INTO `t_inform` VALUES ('cef00068-1ebe-4d95-b68b-c0ade624dd83', '不动产对外服务一', 'news', '/imagesService/getImage?params=/inform/20170630/admin/e0126ed7-344b-43cd-a558-668895730ab0QQ截图20170630132807.png', '<p align=\"center\">第二章&nbsp; 不动产登记簿</p><p>　　第五条&nbsp; 《条例》第八条规定的不动产单元，是指权属界线封闭且具有独立使用价值的空间。</p><p>　　没有房屋等建筑物、构筑物以及森林、林木定着物的，以土地、海域权属界线封闭的空间为不动产单元。</p><p>　　有房屋等建筑物、构筑物以及森林、林木定着物的，以该房屋等建筑物、构筑物以及森林、林木定着物与土地、海域权属界线封闭的空间为不动产单元。</p><p>　　前款所称房屋，包括独立成幢、权属界线封闭的空间，以及区分套、层、间等可以独立使用、权属界线封闭的空间。</p><p>　　第六条&nbsp; 不动产登记簿以宗地或者宗海为单位编成，一宗地或者一宗海范围内的全部不动产单元编入一个不动产登记簿。</p><p>　　第七条&nbsp; 不动产登记机构应当配备专门的不动产登记电子存储设施，采取信息网络安全防护措施，保证电子数据安全。</p><p>　　任何单位和个人不得擅自复制或者篡改不动产登记簿信息。</p><p>　　第八条&nbsp; 承担不动产登记审核、登簿的不动产登记工作人员应当熟悉相关法律法规，具备与其岗位相适应的不动产登记等方面的专业知识。</p><p>　　国土资源部会同有关部门组织开展对承担不动产登记审核、登簿的不动产登记工作人员的考核培训。</p><p></p>', '2017-06-30', 'admin', 'urgent', '0', null);
INSERT INTO `t_inform` VALUES ('de5319c8-7293-4540-920d-93eeb92be397', '不动产对外条例三', 'news', '/imagesService/getImage?params=/inform/20170630/admin/c136300f-03a9-4b93-943f-1bd5c431a0e4QQ截图20170620160007.png', '<p>第十二条&nbsp; 当事人可以委托他人代为申请不动产登记。</p><p>　　代理申请不动产登记的，代理人应当向不动产登记机构提供被代理人签字或者盖章的授权委托书。</p><p>　　自然人处分不动产，委托代理人申请登记的，应当与代理人共同到不动产登记机构现场签订授权委托书，但授权委托书经公证的除外。</p><p>　　境外申请人委托他人办理处分不动产登记的，其授权委托书应当按照国家有关规定办理认证或者公证。</p><p>　　第十三条&nbsp; 申请登记的事项记载于不动产登记簿前，全体申请人提出撤回登记申请的，登记机构应当将登记申请书以及相关材料退还申请人。</p><p>　　第十四条&nbsp; 因继承、受遗赠取得不动产，当事人申请登记的，应当提交死亡证明材料、遗嘱或者全部法定继承人关于不动产分配的协议以及与被继承人的亲属关系材料等，也可以提交经公证的材料或者生效的法律文书。</p><p></p>', '2017-06-30', '1', 'urgent', '0', null);
INSERT INTO `t_legal_content` VALUES ('1', '建筑法', '<p class=\"problemsPosition\">平台条款&gt;服务承诺</p><div class=\"problemsDetails\"><dl class=\"problemsDetails_dl\"><a class=\"problemsDetails_dt\" name=\"step1\">一、服务承诺</a><dd class=\"problemsDetails_dd\">对于认证的机构或用户，<br/> 1、下载的API与描述不符<br/> 2、下载的API不能使用<br/> 3、下载的API存在版权问题<br/> 以上问题均支持沟通协商解决<br/><br/> 对于在发布数据的一般用户（非认证用户），作为科研数据共享服务提供平台，仅为此类用户提供上传空间及在线分享功能，原则仅对该类用户上载数据的表现方式做保护处理，对上载数据本身不做任何修改或编辑，也不保证其数据的真实性、合法性、有效性、专业性。但涉嫌违法的内容（包括但不限于涉黄、涉毒、涉赌、损害国家或民族利益、诽谤他人等等）将无需通知自行删除，并有权封闭或删除该用户。 遵守知识产权相关规定，如果不经意侵犯了相关人员或组织机构的权益，一旦告知查实，将真诚致歉，并承诺立即撤消相关数据。 以上条款最终解释权归所有。</dd></dl><dl class=\"problemsDetails_dl\"><a class=\"problemsDetails_dt\" name=\"step2\">二、免责声明</a><dd class=\"problemsDetails_dd\">本文件于2016年8月1日并生效<br/> 访问者在接受本网站服务之前，请务必仔细阅读本声明。访问者访问本网站的行为以及通过各类方式利用本网站的行为，都将被视作是对本声明全部内容的无异议的认可。<br/> 1、 访问者在从事与本网站相关的所有行为（包括但不限于访问浏览、利用、转载、宣传介绍）时，必须以善意且谨慎的态度行事；访问者不得故意或者过失的损害本网站的各类合法权益，不得利用本网<br/> &nbsp;&nbsp;&nbsp;&nbsp;（1）政府部门、司法机关等依照法定程序要求本网站披露个人资料时，本网站将根据执法单位之要求或为公共安全之目的提供个人资料；<br/> &nbsp;&nbsp;&nbsp;&nbsp;（2）由于用户将个人密码告知他人或与他人共享注册账户，由此导致的任何个人资料泄露；<br/> &nbsp;&nbsp;&nbsp;&nbsp;（3）任何由于计算机问题、黑客攻击、计算机病毒侵入或发作、因政府管制而造成的暂时性关闭等影响网络正常经营的不可抗力而造成的个人资料泄露、丢失、被盗用或被窜改等；<br/> &nbsp;&nbsp;&nbsp;&nbsp;（4）由于与本网站链接的其他网站所造成之个人资料泄露；<br/> &nbsp;&nbsp;&nbsp;&nbsp;（5）因不可抗力导致的任何后果。<br/> 3、本网站若因线路及本网站控制范围外的硬件故障或其它不可抗力而导致暂停服务，于暂停服务期间给用户造成的一切损失，本网站不承担任何法律责任。<br/> 4、除本网站注明之服务条款外，其他一切因使用本网站而引致之任何意外、疏忽、诽谤、版权或知识产权侵犯及其所造成的损失（包括因下载而感染电脑病毒），本网站不承担任何法律责任。<br/> 5、若因本网站产生任何诉诸于诉讼程序的法律争议，均交由以本网站所有者网站所在地的法院判决。<br/> 6、本声明之订立、修改、更新及最终解释权均属网站所有。<br/></dd></dl></div>', 'industryRegulations', '0');
