INSERT INTO `t_legal_content` VALUES ('11', '土地管理法', '<p class=\"problemsPosition\">平台条款&gt;<label>服务承诺</label></p><div class=\"problemsDetails\"><dl class=\"problemsDetails_dl\"><a class=\"problemsDetails_dt\" name=\"step1\">一、服务承诺</a><dd class=\"problemsDetails_dd\">对于认证的机构或用户，<br> 1、下载的API与描述不符<br> 2、下载的API不能使用<br> 3、下载的API存在版权问题<br> 以上问题均支持沟通协商解决<br><br> 对于在发布数据的一般用户（非认证用户），作为科研数据共享服务提供平台，仅为此类用户提供上传空间及在线分享功能，原则仅对该类用户上载数据的表现方式做保护处理，对上载数据本身不做任何修改或编辑，也不保证其数据的真实性、合法性、有效性、专业性。但涉嫌违法的内容（包括但不限于涉黄、涉毒、涉赌、损害国家或民族利益、诽谤他人等等）将无需通知自行删除，并有权封闭或删除该用户。 遵守知识产权相关规定，如果不经意侵犯了相关人员或组织机构的权益，一旦告知查实，将真诚致歉，并承诺立即撤消相关数据。 以上条款最终解释权归所有。</dd></dl><dl class=\"problemsDetails_dl\"><a class=\"problemsDetails_dt\" name=\"step2\">二、免责声明</a><dd class=\"problemsDetails_dd\">本文件于2016年8月1日并生效<br> 访问者在接受本网站服务之前，请务必仔细阅读本声明。访问者访问本网站的行为以及通过各类方式利用本网站的行为，都将被视作是对本声明全部内容的无异议的认可。<br> 1、 访问者在从事与本网站相关的所有行为（包括但不限于访问浏览、利用、转载、宣传介绍）时，必须以善意且谨慎的态度行事；访问者不得故意或者过失的损害本网站的各类合法权益，不得利用本网<br> &nbsp;&nbsp;&nbsp;&nbsp;（1）政府部门、司法机关等依照法定程序要求本网站披露个人资料时，本网站将根据执法单位之要求或为公共安全之目的提供个人资料；<br> &nbsp;&nbsp;&nbsp;&nbsp;（2）由于用户将个人密码告知他人或与他人共享注册账户，由此导致的任何个人资料泄露；<br> &nbsp;&nbsp;&nbsp;&nbsp;（3）任何由于计算机问题、黑客攻击、计算机病毒侵入或发作、因政府管制而造成的暂时性关闭等影响网络正常经营的不可抗力而造成的个人资料泄露、丢失、被盗用或被窜改等；<br> &nbsp;&nbsp;&nbsp;&nbsp;（4）由于与本网站链接的其他网站所造成之个人资料泄露；<br> &nbsp;&nbsp;&nbsp;&nbsp;（5）因不可抗力导致的任何后果。<br> 3、本网站若因线路及本网站控制范围外的硬件故障或其它不可抗力而导致暂停服务，于暂停服务期间给用户造成的一切损失，本网站不承担任何法律责任。<br> 4、除本网站注明之服务条款外，其他一切因使用本网站而引致之任何意外、疏忽、诽谤、版权或知识产权侵犯及其所造成的损失（包括因下载而感染电脑病毒），本网站不承担任何法律责任。<br> 5、若因本网站产生任何诉诸于诉讼程序的法律争议，均交由以本网站所有者网站所在地的法院判决。<br> 6、本声明之订立、修改、更新及最终解释权均属网站所有。<br></dd></dl></div>', 'industryRegulations', '0');
