INSERT INTO `t_legal_content` VALUES ('521b44be-bb5a-420c-ad72-d646c916be0b', '不动产权法律法规', '<div class=\"para\" label-module=\"para\">不动产（immovable property）这一词原本来源于日本，意思类似房地产。在中国是指依自然性质或法律规定不可移动或者移动后会引起性质、形状改变的财产，包括建筑物、构筑物等。</div><div class=\"para\" label-module=\"para\">2013年11月20日，国务院常务会议决定，整合不动产<a href=\"http://baike.baidu.com/item/%E7%99%BB%E8%AE%B0\" target=\"_blank\">登记</a>职责、建立不动产统一登记制度。<sup>[1]</sup><a name=\"ref_[1]_10970\" class=\"sup-anchor\">&nbsp;</a> 不动产登记参照《不动产登记管理条例》。</div><p></p>', 'industryLaw', '0');
