INSERT INTO `t_legal_content` VALUES ('6d9235d0-ed40-400f-8bf4-6c1f86cb7cf3', '房地产规制法', '<p>第二十条&nbsp; 不动产登记机构应当根据不动产登记簿，填写并核发不动产权属证书或者不动产登记证明。</p><p>　　除办理抵押权登记、地役权登记和预告登记、异议登记，向申请人核发不动产登记证明外，不动产登记机构应当依法向权利人核发不动产权属证书。</p><p>　　不动产权属证书和不动产登记证明，应当加盖不动产登记机构登记专用章。</p><p>　　不动产权属证书和不动产登记证明样式，由国土资源部统一规定。</p><p></p>', 'industryLaw', '0');
