INSERT INTO `t_legal_content` VALUES ('aa1cc4f4-60b9-4e12-9607-977fff2d7b88', '不动产所有权', '动产<a href=\"http://baike.baidu.com/item/%E6%89%80%E6%9C%89%E6%9D%83\" target=\"_blank\">所有权</a>的对称。以不动产为标的物的所有权。不动产指无法移动或移动后会导致形状、性质改变的物。不动产所有权的特点在于其移转必须采取特定的方式。<div><div class=\"para-title level-2\" label-module=\"para-title\"><h2 class=\"title-text\">土地所有权</h2><a class=\"edit-icon j-edit-link\" style=\"display: block;\" data-edit-dl=\"2\"><em class=\"cmn-icon wiki-lemma-icons wiki-lemma-icons_edit-lemma\"></em>编辑</a></div><div class=\"para\" label-module=\"para\"><b>（一）土地所有权的概念</b></div><div class=\"para\" label-module=\"para\"><a href=\"http://baike.baidu.com/item/%E5%9C%9F%E5%9C%B0%E6%89%80%E6%9C%89%E6%9D%83\" target=\"_blank\">土地所有权</a>系以土地为其标的物，它是土地所有人独占性地支配其所有的土地的权利。土地所有人在法律规定的范围内可以对其所有的土地进行占有、使用、收益、处分，并可排除他人的干涉。</div><div class=\"para\" label-module=\"para\"><b>民法通则以及土地管理法等法律规定</b></div><div class=\"para\" label-module=\"para\">民法通则以及土地管理法等法律确认了土地所有人的独占性支配权。虽然法律没有明确规定其效力范围，但从法律的宗旨及其实践来看，土地所有权的效力范围，在横的方面，是以地界为限；从纵的方面，不仅包括地面，也包括地上及地下。</div><div class=\"para\" label-module=\"para\"><b>主要限制方面</b></div><div class=\"para\" label-module=\"para\">中国土地所有权的这种及于地上及地下的效力，并不是无限制的。这种限制主要有两方面：（1）内在的限制。土地所有权的客体，以人力所能支配并满足所有人的需要为要件，即是说，土地所有权的支配力，仅限于其行使受到法律保护的利益的范围。对此范围外他人在其地上及地下的干涉，土地所有人不得排除之。例如，地下开凿隧道、地上通航飞机，土地所有人不得请求排除。（2）法律的限制。法律对土地所有权的限制很多，除了相邻关系的规定外，还有国防、电信、交通、自然资源、环境保护、名胜古迹等方面的限制。</div><div class=\"anchor-list\"><a name=\"2_1\" class=\"lemma-anchor para-title\"></a> <a name=\"sub257209_2_1\" class=\"lemma-anchor \"></a> <a name=\"国家土地所有权\" class=\"lemma-anchor \"></a> </div><div class=\"para-title level-3\" label-module=\"para-title\"><h3 class=\"title-text\"><span class=\"title-prefix\">不动产所有权</span>国家土地所有权</h3></div><div class=\"para\" label-module=\"para\">宪法、民法通则、土地管理法等法律，对国家土地所有权做了明确规定。土地管理法第6条规定：城市市区的土地属于全民所有即国家所有。农村和城市郊区的土地，除法律规定属于国家所有的以外，属于集体所有。</div><div class=\"para\" label-module=\"para\"><b>属于国家所有的土地有</b></div><div class=\"para\" label-module=\"para\">（1）城市市区的土地。在中国对于城市市区的认识是十分模糊的，这是需要以法律的形式进一步明确的问题。一般来讲，城市市区的土地，是指直辖市、地级市、县级市以及县城所在镇市区的土地。这些土地主要不是农业用地，而是工业、交通、文化、建筑用地及城市居民用地。</div><div class=\"para\" label-module=\"para\">（2）农村和城市郊区中已经依法没收、征收、收购为国有的土地。</div><div class=\"para\" label-module=\"para\">（3）国家依法征用的土地。</div><div class=\"para\" label-module=\"para\">（4）依法不属于集体所有的林地、草原、荒地、滩涂及其他土地。</div><div class=\"para\" label-module=\"para\">（5）农村集体经济组织全部成员转为城镇居民的，原属于其成员集体所有的土地。</div><div class=\"para\" label-module=\"para\">（6）因国家组织移民、自然灾害等原因，农民成建制地集体迁移后不再使用的原属于迁移农民集体所有的土地。</div><div class=\"para\" label-module=\"para\"><b>国家土地使用规定</b></div><div class=\"para\" label-module=\"para\">国有土地虽然由国家享有其所有权，但一般情况下并不由国家直接使用、经营，而是由国务院主管部门主管全国土地的统一管理工作，县级以上地方人民政府土地管理部门统一管理本行政区域内的土地。国有土地，可以依法确定给单位或者个人使用。国有土地也可以由单位或者个人承包经营，从事种植业、林业、畜牧业、渔业生产。土地管理法第2条的规定，国家依法实行国有土地有偿使用制度。但是，国家在法律规定的范围内划拨国有土地使用权的除外。</div><div class=\"anchor-list\"><a name=\"2_2\" class=\"lemma-anchor para-title\"></a> <a name=\"sub257209_2_2\" class=\"lemma-anchor \"></a> <a name=\"集体土地所有权\" class=\"lemma-anchor \"></a> </div><div class=\"para-title level-3\" label-module=\"para-title\"><h3 class=\"title-text\"><span class=\"title-prefix\">不动产所有权</span>集体土地所有权</h3></div><div class=\"para\" label-module=\"para\">集体土地所有权是由各个独立的集体组织享有的，对其所有的土地的独占性支配权利。根据土地管理法第8条的规定，属于集体所有的土地，是指除法律规定属于国家所有以外的、农村和城市郊区的土地以及宅基地、自留地。</div><div class=\"para\" label-module=\"para\"><b>集体土地所有权的主体</b></div><div class=\"para\" label-module=\"para\">集体土地所有权的主体，即享有土地所有权的集体组织，有以下三类：（1）村农民集体。村农业生产合作社等农业集体经济组织或者村民委员会具体地对土地进行经营、管理；（2）如果村范围内的土地已经分别属于村内两个以上农业集体经济组织所有的，可以属于各该农业集体经济组织的农民集体所有；（3）土地如果已经属于乡（镇）农民集体所有的，可以属于乡（镇）农民集体所有。</div><p></p><div><br/></div></div>', 'industryRegulations', '0');
